import{_ as e,p as a,q as t,Z as r}from"./framework-1749bed7.js";const n={},c=r('<h2 id="前端面试宝典" tabindex="-1"><a class="header-anchor" href="#前端面试宝典" aria-hidden="true">#</a> 前端面试宝典</h2><p>前端是个非常年轻的行业，年轻意味着它有着广阔的发展空间和大量的机遇，它正保持以百米冲刺的速度飞速成长着。前端也在为更多的业务场景赋能，网页web、移动应用、桌面应用、人工智能等领域均能看到前端的身影。</p><p>我相信很多前端的同学都有过这样的感慨：</p><p>前端门槛低，但精通极难； 知识体系庞大，无从下手； 技术更新太快，学不过来； 前端的未来在哪里？架构师？项目管理？还是全栈工程师？ 前端的快速发展让很多前端人陷入了“内卷化”的困境，学什么？怎么学？如何保持高效？学到什么程度？成了很多前端人成长道路上的四座冰山。想要破冰，其实也很简单，首先我们得明确自己的学习目标，然后以目标为导向，梳理出一条清晰的学习路径，最后沿着这条路径持续前进。我们都在前端这条路上探索着，吃了很多学习的苦，但这些苦都将成为你未来升职加薪、步入更广阔的发展平台的铺路石。</p><p>前端学习不可怕，我希望从我的经验出发，带领你找到前端学习的方向，共同成长。前端广阔如江海，但我们的心中已有灯塔，扬帆，起航！</p><h2 id="仓库的本质" tabindex="-1"><a class="header-anchor" href="#仓库的本质" aria-hidden="true">#</a> 仓库的本质</h2><p>在这个信息爆炸，前端生态百花齐放的时代，我们每找寻一个答案都要换一种形式，这简直太奢侈了。</p><p>我们的目标是做最全最好最有质量前端面试仓库，用心收录大厂面试题，高频面试题，知识点面试题，用心做好每一道题值得参考的题解。</p>',8),d=[c];function i(s,h){return a(),t("div",null,d)}const p=e(n,[["render",i],["__file","index.html.vue"]]);export{p as default};
